import { React, useEffect, useState } from 'react';
import './Main.css';
import axios from 'axios';

const Main = () => {

    const [breeds, setBreeds] = useState([])

    useEffect(() => {
        axios.get('https://dog.ceo/api/breeds/list/all')
        .then(res => {
            console.log(res.data.message)
            let breedsArr = []
            for(var i in res.data.message){
                if(Boolean(res.data.message[i][0])){
                    for(var j in res.data.message[i]){
                        // console.log(`${res.data.message.i} ${res.data.message[i][j]}`)
                        breedsArr.push(`${i} ${res.data.message[i][j]}`)
                    }
                }
            }
            console.log(breedsArr)
            setBreeds(breedsArr)
        })
        .catch(err => {
            console.log(err)
        })
    }, [])

    useEffect(() => {
        console.log(breeds)
    }, [breeds])

    const breedsList = breeds.map(el => {
        return <h1>{el}</h1>
    })

    return (
        <div>
            {breedsList}
        </div>
    );
}

export default Main;
